import CartItem from "./CartItem"
import Card from "./Card"

export default function Checkout({cartItems, title}){
    return(
        <>
         <ol className="list-group list-group-numbered">
          {cartItems.map((d) => (
            <CartItem title={title} />
          ))}
        </ol>
        </>
    )
}
